import React, { Component } from 'react'

export default class renderDom extends Component {
    render() {
        return (
            <div>
                <h1> React Dom Project </h1>
                <h2>render DOM</h2>
                <p> render() -> ReactDOM.render(element.container[, callback]) </p>
                <button> change name </button>
                <h2> developer green </h2>
            </div>
        )
    }
}
